import React, { Component } from 'react';
import { withCookies } from 'react-cookie';
import Button from '@material-ui/core/Button';
import { DropzoneDialog } from 'material-ui-dropzone';
import './index.css';
const { imageData } = require('../../matcha_pb');

class InitialPhoto extends Component {
	constructor(props) {
		super(props);

		this.state = {
			open: false
		}
	}

	sendImage = () => {
		const request = new imageData();
		request.setImage('');
		request.setIndex(2);
		const uid = this.props.cookies.get('uid');
		const temp = this.props.cookies.get('session_id');
		const metadata = {
			'user_id': uid,
			'session_id': temp
		}
		console.log('aa');
		window.Aclient.updateImage(request, metadata, (err, reply) => {
			if (err) {
				console.log(err.code);
				console.log(err.message);
			} else {
				// console.log(reply.getMessage());
			}
		})
	}

	componentDidMount() {
		this.sendImage();
	}

	handleOpen() {
		this.setState({
				open: true,
		});
	}

	handleSave(files) {
		console.log('save', files);
		this.setState({
				files: files, 
				open: false
		});
		this.sendImage(files);
	}

	handleClose() {
		this.setState({
				open: false
		});
	}

	render() {
		return (
			<div>
				<aside className='title'>Photos of You</aside>
				<div className='imagearea'>
					<div className='addplusmax'>
						<div className='addimages'>
							<Button id='iii' onClick={this.handleOpen.bind(this)}>
								Add Image
							</Button>
							<DropzoneDialog
								open={this.state.open}
								onSave={this.handleSave.bind(this)}
								acceptedFiles={['image/jpeg', 'image/jpg', 'image/png', 'image/bmp']}
								showPreviews={true}
								maxFileSize={5000000}
								onClose={this.handleClose.bind(this)}
							/>
						</div>
						<div id='max'>*Maximum 5</div>
					</div>
					<div className='nailarea'>
						{/* {this.state.pics.map(pic => (
							<img src={`http://localhost:8000/api${pic.file}`}  width={100} height={65}/>
						))} */}
					</div>
				</div>
			</div>
		)
	}
}

export default withCookies(InitialPhoto);
